import { HttpClient } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { FormBuilder, FormGroup } from '@angular/forms';

@Component({
  selector: 'app-login',
  templateUrl: './login.component.html',
  styleUrls: ['./login.component.css']
})
export class LoginComponent implements OnInit {

  form: FormGroup;

  constructor(private formBuilder: FormBuilder,
    private http:HttpClient)
  {
    this.form = this.formBuilder.group({
      email:'',
      password:''
     });
  }

  ngOnInit(): void {

  }

  submit():void
  {
    this.http.post('http://localhost:3000/api/login', this.form.getRawValue()).subscribe()
  }
}
<main class="form-signin w-100 m-auto">
  <form [formGroup]="form" (submit)="submit()">

    <h1 class="h3 mb-3 fw-normal">Prijavi se</h1>

      <input formControlName="email" type="email" class="form-control"  placeholder="Email">

      <input formControlName="password" type="password" class="form-control"  placeholder="Password">

    <button class="btn btn-primary w-100 py-2" type="submit">Prijavi se</button>

  </form>
</main>
